import React from 'react';
import styles from './style.scss';
import { Page, PageContent, Card, Button, CardContent } from '@hvisions/f-ui';
import classnames from 'classnames';

const ManualSheet = ({ item }) => {
  const data = [
    {
      code: '111',
      taskStatus: '222',
      state: '333'
    },
    {
      code: '444',
      taskStatus: '555',
      state: '666'
    },
    {
      code: '444',
